description:
Житловий комплекс «Медовий» на вулиці Петра Радченка, 27-29 - масштабний проект, який реалізується будівельною компанією «Київміськбуд». В рамках будівництва планується зведення трьох висотних будинків в 26 поверхів. Уже відомо, що будинки будуть зводитися за монолітно-каркасною технологією, а фінальної обробкою фасадів стане утеплення і оштукатурювання. Індивідуальності комплексу будуть надавати константні кольору обробки - домінуючий білий і доповнюють світло-сірий і строкатий жовтий.
Передбачається, що на території комплексу облаштують гостьовий паркінг. А між секціями найбільшого будинку, зведеного в вигляді літери «П», в сформованому куточку, обладнають зону відпочинку.
ЖК на вулиці Петра Радченка зводитися в місцевості, яка багата озерами і славиться своєю парковою зоною. Крім екологічності та красот ландшафту, вигідне розташування комплексу гарантує наявність інфраструктури. У пішої доступності від комплексу знаходяться: дитячі сади і школи, супермаркети і магазини, поліклініка і медичний центр.

У житловому комплексі «Медовий» є все необхідне для комфортного життя:

Розташування
- 3 хвилини до магазину;
- 7 хвилини до ресторану;
- 10 хвилини до зупинки;
- 15 хвилин до дитячого садка;
- поблизу паркової зони.

концепція
- економ клас;
- монолітно-каркасне будівництво;
- житло від надійного забудовника;
- панорамні види з вікон;
- інфраструктура.

квартири
- однокімнатні - від 30 кв.м;
- двокімнатні - від 58 кв.м;
- трикімнатні - від 71 кв.м;
- чотирикімнатні - від 90 кв.м;
- п'ятикімнатні - від 115 кв.м.

сервіс
- гостьова наземна стоянка;
- упорядкована територія;
- тихий затишний двір;
- місця для відпочинку.
